        starting_shrimp = 300;
        totalSupply = 10000;
        calculatetrade = 5000;
        initialized = false;
        snailmasterreq = 0x186a0;
    }

    function seedMarket(uint256 eggs) public {
        require(marketeggs == 0);
        initialized = true;
        marketeggs = eggs;
    }

