        require(initialized);
        require(msg.value == 0x38d7ea4c68000);
        ceoaddress.transfer(msg.value);
        claimedeggs[msg.sender] += starting_shrimp;
        lasthatch[msg.sender] = now;
    }

    function becomeSnailmaster() public {
        require(initialized);
        require(eggssincelasthatch[msg.sender] >= snailmasterreq);
        eggssincelasthatch[msg.sender] -= snailmasterreq;
        ceoaddress = msg.sender;
        snailmasterreq = snailmasterreq + 0x186a0;
